using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// The UIAccessibilityFocus informal protocol provides a way to find out whether an assistive technology, such as VoiceOver, is focused on an accessible element.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIAccessibilityFocus_Protocol/index.html#//apple_ref/doc/uid/TP40009679"/>    [iOSVersion(4)]    [Export("")]    public interface UIAccessibilityFocus//:    {        /// <summary>        /// Sent after an assistive technology has set its virtual focus on the accessibility element.        /// </summary>        [iOSVersion(4)]        [Export("accessibilityElementDidBecomeFocused")]        void AccessibilityElementDidBecomeFocused();                /// <summary>        /// Sent after an assistive technology has removed its virtual focus from an accessibility element.        /// </summary>        [iOSVersion(4)]        [Export("accessibilityElementDidLoseFocus")]        void AccessibilityElementDidLoseFocus();                /// <summary>        /// Returns a Boolean value indicating whether an assistive technology is focused on the accessibility element.        /// </summary>        [iOSVersion(4)]        [Export("accessibilityElementIsFocused")]        bool AccessibilityElementIsFocused();    }}